import React from 'react';

class Form extends React.Component{

    render(){
        return (
            <form onSubmit={this.props.weatherMethod.bind(this)}>
                <input type="text" name="city" placeholder="city" />
                <button>Отримати погоду</button>
            </form>
        )
    }
}

export default Form;
